import React from 'react';
import PropTypes from 'prop-types';
import { Link } from 'react-router-dom'
export default function ModuleListTable(props) {
  const { moduleList } = props;
  return (
    <div className="table-responsive">
      <table className="display dtable w-100" >
        <thead>
          <tr>
            <th>S.No</th>
            <th>Module Name</th>
            <th>NO. OF MATERIALS </th>
            <th>STATUS</th>
          </tr>
        </thead>
        <tbody>
          <TableBody
            moduleList={moduleList}
          />
        </tbody>
      </table>
    </div>
  )
}

function TableBody(props) {
  const { moduleList } = props;
  let moduleListData = [];
  if (moduleList.length > 0) {
    moduleListData = moduleList.map((module, index) => (
      <tr>
        <td>{index + 1}</td>
        <td>{module.subject_name}</td>
        <td>
          <Link to={`/Dashboard/MBookLet/material/${module.subject_id}`}>
            {module.material_count}
          </Link>
        </td>
        <td>
          <div className="custom-control custom-switch">
            <input checked={module.status} type="checkbox" className="custom-control-input" id="switch1" name="example" />
            <label className="custom-control-label" htmlFor="switch1" />
          </div>
        </td>
      </tr>
    ))
    return moduleListData;
  }
  return (
    <tr>
      <td colSpan="4">No Modules Found</td>
    </tr>
  )
}


ModuleListTable.prototype = {
  moduleList: PropTypes.array
}
